import React from 'react'

export class MainContainer extends React.Component{

    constructor(props){
        super(props);
    }



    render(){
        return(
        <>
        <div className="mainContainer">
            <div className="header">
                <button className="navBtn activeState" id="log" >Login</button>
                <button className="navBtn" id="reg" >Register</button>
            </div>
            <div id="core">

            </div>
        </div>
        </>
        )
    }
}
